import './App.css';
import Header from './Components/Header';
import Home from './Components/Home';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom'; 

function App() {
  return (
      <Router>
        <div className='App'>
          <Switch>
            <Route path='/about'>
              <h1>About</h1>
            </Route>
            <Route path='/'>
              <h1>Home</h1>
            </Route>
          </Switch>
        </div>
      </Router>
  );
}

export default App;

function About() {
  return(
    <div>
      <h1>About</h1>
    </div>
  )
}
